    false,nt"url": null,nt"notes": "This dataset represents geochemical or
    geophysical attributes in surface or near surface geology within individual, local
    NHDPlusV2 catchments and upstream, contributing watersheds. Attributes of the landscape
    layer were calculated for every local NHDPlusV2 catchment and accumulated to provide
    watershed-level metrics. (See Supplementary Info for Glossary of Terms) For information
    regarding how the Landscape layers were created see https://www.sciencebase.gov/catalog/item/53481333e4b06f6ce034aae7.
    Landscape Layers are partitioned into 4 tables based on the location of no-data
    cells within their rasters to correctly reflect the PctFull attributes within each
    table (see Data Structure and Attribute Information for a description).",nt"license_title":
